(2, 'Privacy & Policy', 'privacy', '<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.5pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#555555\"=\"\">When you visit the\r\nSite, we automatically collect certain information about your device, including\r\ninformation about your web browser, IP address, time zone, and some of the\r\ncookies that are installed on your device.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.5pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#555555\"=\"\">Additionally, as you\r\nbrowse the Site, we collect information about the individual web pages or\r\nproducts that you view, what websites or search terms referred you to the Site,\r\nand information about how you interact with the Site. We refer to this\r\nautomatically collected information as&nbsp;</span><b><span style=\"font-size:\r\n13.5pt;mso-bidi-font-size:14.0pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:#555555\"=\"\">Device Information</span></b><span style=\"font-size:13.5pt;font-family:\" arial\",\"sans-serif\";mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:#555555\"=\"\">.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; back