ation and Order Information.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><b><span style=\"font-size:13.5pt;mso-bidi-font-size:14.0pt;font-family:\r\n\" arial\",\"sans-serif\";mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#555555\"=\"\">HOW\r\nDO WE USE YOUR PERSONAL INFORMATION</span></b><span style=\"font-size:13.5pt;\r\nfont-family:\" arial\",\"sans-serif\";mso-fareast-font-family:\"times=\"\" new=\"\" roman\";=\"\" color:#555555\"=\"\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.5pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#555555\"=\"\">We use the Order Information\r\nthat we collect generally to fulfill any orders placed through the Site\r\n(including processing your payment information, arranging for shipping, and\r\nproviding you with invoices and/or order confirmations).<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 7.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:13.5pt;font-family:\" arial\",\"sans-serif\";=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";color:#555555\"=\"\">Additionally, we use\r\nthis Order Information to: - Communicate with you. - Screen our orders for\r\npotential risk or fraud. - When in 